import React from 'react'
import imageFacebook from "../../src/images/ico-facebook.png"





const Footer = () => {

 
  return (
    <footer className='footer'>
        <h2>DIGITAL HOUSE</h2>
        <img className='facebook' src='../../src/images/ico-facebook.png' alt="facebook" />
       
    </footer>
  )
}

export default Footer
